import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Register from "./pages/Register";

const App = () => {
	return (
		<BrowserRouter>
			<Routes>
				<Route path="/" component={Register} /> />
			</Routes>
		</BrowserRouter>
	);
};

export default App;
